import WaitingList from "./components/WaitingList";
import CreateParty from "./components/CreateParty";

function App() {
  const parties = [
    {
      name: "Sam",
      size: 3,
      phoneNumber: "(781)383-6375",
      quotedTime: "5:00 PM",
    },
    {
      name: "Liane",
      size: 3,
      phoneNumber: "(781)666-5555",
      quotedTime: "5:00 PM",
    },
    {
      name: "Lisa",
      size: 5,
      phoneNumber: "(123)456-7890",
      quotedTime: "5:00 PM",
    },
  ];

  console.log(parties);

  return (
    <div className="app mx-auto modal-container grid bg-blue-100">
      <WaitingList parties={parties} />
      <CreateParty />
    </div>
  );
}

export default App;
